import { Line } from 'react-chartjs-2';
import React from 'react';

const state = {
    labels: ['January', 'February', 'March',
             'April', 'May'],
    datasets: [
      {
        label: 'Rainfall',
        
        data: [65, 59, 80, 81, 56],
        
        fill: false,
        lineTension: 0.1,
        borderColor: 'rgba(75,192,192,1)',
        pointBorderWidth: 5,
		pointHoverRadius: 9,


      }
    ]
  };

  const LineDiagram:React.FC = () => {

    return(
        <div>
            <Line data={state}
            options={{
                title:{
                    display:true,
                    text:'Average Rainfall per month',
                    fontSize:20
                },
                legend:{
                    display:true,
                    position:'right'
                }
            }}
            />
        </div>
    );
  }

  export default LineDiagram;
